//             <a id="navbar2">Find a Job</a>
//           </Link>
//         </div>
//         <div>
//           <Link href="/testing">
//             <a id="navbar3">About Us</a>
//           </Link>
//         </div>
//         <div>
//           <Link href="/">
//             <a id="navbar4">Home</a>
//           </Link>
//         </div>
//       </nav>
//     </body>
//   );
// };

const NavbarLink = ({ children, ...props }) => (
  <Text px={5} {...props}>
    {children}
  </Text>
);

const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between" px={5} py={4}>
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <Link href="/">
        <a>Jobaho</a>
      </Link>
    </Flex>
    <Box>
      <Link href="/">
        <NavbarLink>
          <a>Home</a>
        </NavbarLink>
      </Link>
      <Link href="/about">
        <NavbarLink>
          <a>About</a>
        </NavbarLink>
      </Link>
      <Link href="/jobSection">
        <NavbarLink>
          <a>Find a Job</a>
        </NavbarLink>
      </Link>
    </Box>
  </Flex>
);

export default Navbar;
